script.xsl:text:
// format messages inside Tests section and display the Tests section
var tnodes = document.getElementsByName('testmsg');
for (var i = 0; i < tnodes.length; i++) {
    var testdata = tnodes[i].innerHTML;
    testdata = testdata.replace(/#SD#/g, '<span>');
    testdata = testdata.replace(/#ED#/g, '</span>');
    tnodes[i].innerHTML = '<pre><code>' + testdata + '\n</code></pre>'
}
document.getElementById("testsec").style.display = "inline";

// create failure summary table
var testcmdhdr = "<span>Test Cmd: </span>";
var failinfo = {};
var failnodes = document.getElementsByName('failtest');
for (var i = 0; i < failnodes.length; i++) {
    var testdata = failnodes[i].getElementsByTagName('code')[0].innerHTML;
    var startpos = testdata.indexOf(testcmdhdr);
    startpos += startpos != -1 ? testcmdhdr.length : 0;
    var endpos = startpos != -1 ? testdata.indexOf("\n", startpos) : -1;
    var testcmd = endpos != -1 ? (startpos != -1 ? testdata.substring(startpos, endpos) : "") : (startpos != -1 ? testdata.substr(startpos) : "");
    var testid = failnodes[i].getElementsByTagName('p')[0].getAttribute('id');
    var testnum = failnodes[i].getElementsByTagName('p')[0].innerHTML;
    failinfo[testid] = { testnum : testnum, testcmd : testcmd };
}

var box = "";
for (var testid in failinfo) {
    box += "<tr>";
    box += "<td><a href='#" + testid + "'/>" + failinfo[testid].testnum + "</td>"
    box += "<td><a href='#" + testid + "'/>" + failinfo[testid].testcmd + "</td>"
    box += "</tr>";
}
if (box != "") {
    var starttag = "<table id='failtable'><tr><th>Test Number</th><th>Test Command</th>";
    var endtag = "</table>";
    box = starttag + box + endtag;
    document.getElementById("failtableph").innerHTML = box;
}
